import React from "react";
import { Grid, CardMedia, IconButton, withStyles } from "@material-ui/core";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faChevronLeft,
  faChevronRight
} from "@fortawesome/free-solid-svg-icons";

const styles = theme => ({
  container: {
    flexGrow: 1,
    background: "blue"
  },
  landingPage: {},
  grid: {
    alignContent: "center",
    alignItems: "center",
    justifyContent: "space-between",
    flexGrow: 1
  }
});

class Home extends Component {
  render() {
    return (
      <div className={classes.container}>
        <CardMedia image="" className={classes.landingPage}>
          <Grid className={classes.grid} container direction="row" style={{}}>
            <IconButton>
              <FontAwesomeIcon
                style={{ color: "white" }}
                icon={faChevronLeft}
              />
            </IconButton>
            <IconButton>
              <FontAwesomeIcon
                style={{ color: "white" }}
                icon={faChevronRight}
              />
            </IconButton>
          </Grid>
        </CardMedia>
      </div>
    );
  }
}

// const Home = withStyles(styles)(({ classes }) => (

// ));

export default Home;
